■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>忙しい毎日を過ごしている方に。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5332/1022303-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>●栄養補助食品として、1日2粒を目安に水またはぬるま湯と共にお召し上がりください。<br><br>【保存方法】<br>●高温多湿、直射日光を避けて保存してください。<br>●開封後はチャックをしっかりと閉めて保管し、お早めにお召し上がりください。<br><br>【注意事項】<br>●お体に合わない場合はご使用をおやめください。<br><br>【販売者】<br>株式会社ユニマットリケン<br>東京都港区南青山2-7-28</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">「5年根」の高麗人参を丁寧に蒸しあげ、天日乾燥した紅参からエキスを抽出し、乳酸菌で発酵熟成させた発酵高麗人参とペルー政府に管理されて栽培されたマカの濃縮エキスを配合。更にバイオペリン(黒胡椒抽出物)をプラスした栄養補助食品です。</font></td></tr></table><br> <table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><h1><font color="#333333" size="3">健康食品/サプリメント/サプリ/タブレット/健康維持/東洋ハーブ/20倍濃縮マカエキス/チャック式</font></h1></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【1日目安量2粒(0.6g)あたり】<br>エネルギー:2.3kcal、たんぱく質:0.01g、脂質:0.01g、炭水化物:0.53g、ナトリウム:0.08mg、高麗人参生換算:1000mg、マカ生換算:1000mg、黒胡椒抽出物(バイオペリン):2.5mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">麦芽糖、コーンスターチ、発酵高麗人参エキス末、マカエキス末、黒胡椒抽出物、結晶セルロース、ステアリン酸カルシウム、微粒二酸化ケイ素</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">「5年根」の高麗人参を丁寧に蒸しあげ、天日乾燥した紅参からエキスを抽出し、乳酸菌で発酵熟成させた発酵高麗人参とペルー政府に管理されて栽培されたマカの濃縮エキスを配合。更にバイオペリン(黒胡椒抽出物)をプラスした栄養補助食品です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">18.6g(300mg×62粒)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：9×15×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：25g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：発酵高麗人参、マカエキス含有食品</font><br> <font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
